import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';

import CompaniesList from './components/CompaniesList';



function App() {
  return (
    <Router>
      <div className="App">
      <header className="App-header">
        <h1>
        COMPANIES DASHBOARD
        </h1>

        <Switch>
        <Route path="companies" >
        <CompaniesList/>

        </Route>
        </Switch>

      </header>
    </div> 
    </Router>
  );
}

export default App;
